import * as React from 'react';

import { MuiSvgIcon } from '@material-ui/core';
import Github from '../svgs/github.svg';
import Linkedin from '../svgs/linkedin.svg';

const Icons = () => {
  return (
    <div className='icons'>
      <MuiSvgIcon className='github-icon' component={<Github />} inheritViewBox/>
      <MuiSvgIcon className='linkedin-icon' component={<Linkedin />} inheritViewBox/>
    </div>
  );
}

export default Icons;
